import React from 'react';
import {Link} from "react-router-dom";
import "../styles/Navbar.css";

function Footer() {
  return (
    <footer className="footer">
      <ul className="footer-links">
        <li><a href="/colonoscopy-resources">Colonoscopy Resources</a></li>
        <li><a href="/patient-feedback">Patient Feedback</a></li>
        <li><a href="https://www.albertahealthservices.ca/info/page10048.aspx" target="_blank" rel="noopener noreferrer">811 HealthLink</a></li>
        <li><a href="https://www.albertahealthservices.ca/" target="_blank" rel="noopener noreferrer">AHS Website</a></li>
        <li><a href="/contact-us">Contact Us</a></li>
        <li><a href="/faq">FAQ</a></li>
        <li><a href="/glossary">Glossary</a></li>
      </ul>
    </footer>
  );
}

export default Footer;
